import React from "react";
import gym2 from "./images/gym2.jpg";

const Firstpage = () => {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col-md-10 mx-auto" style={{ border: "2px solid" }}>
            <div className="row">
              <div className="col-md-6">
                  <h1>Join us to get in Shape</h1>
              </div>
              <div className="col-md-6"></div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Firstpage;
